import React from 'react';
import './projects.css';
import customCard from "./customCard";

// Imports from MUI lib
import Paper from "@mui/material/Paper"; // Import your styles

function ProjectsPage() {

    const cardData = [
        {
            id: 1,
            title: 'Lizard',
            content: 'Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging across all continents except Antarctica',
            image: '/static/images/cards/contemplative-reptile.jpg',
            actionButtonLabel: 'Share',
            onActionButtonClick: () => alert('Share clicked'), // Add your custom action here
        },
        // Add more card data as needed
    ];
    
    return (
        <div className='projects-container'>
            <Paper className="paperContainer" elevation={3}>
                <Typography variant="h4" gutterBottom>
                    White Paper
                </Typography>
                <Grid container spacing={2}>
                    {[1, 2, 3, 4, 5, 6, 7, 8, 9].map((cardNumber) => (
                        <Grid item key={cardNumber} className="card">
                            {/* Replace the content with your actual card component */}
                            <Paper elevation={3} className="innerCard">
                                <Typography variant="h6" gutterBottom>
                                    Card {cardNumber}
                                </Typography>
                                <Typography>
                                    Some card content goes here. Adjust as needed.
                                </Typography>
                            </Paper>
                        </Grid>
                    ))}
                </Grid>
            </Paper>
        </div>
    );
}

export default ProjectsPage;
